      {"9cd90130-3a1b-4b5e-92fe-77d507ca1f46":{"version":"3.6.3","title":"Bokeh Application","roots":[{"type":"object","name":"Column","id":"p1271","attributes":{"children":[{"type":"object","name":"Row","id":"p1267","attributes":{"children":[{"type":"object","name":"Div","id":"p1265","attributes":{"width":350,"text":"\n    &lt;h2&gt;Software Engineering Productivity Model&lt;/h2&gt;\n    &lt;p&gt;This model simulates software engineering productivity based on team size and various factors that impact overall efficiency.&lt;/p&gt;\n    &lt;h3&gt;Model Factors:&lt;/h3&gt;\n    &lt;ul&gt;\n        &lt;li&gt;&lt;strong&gt;Communication Overhead:&lt;/strong&gt; As team size grows, communication channels increase approximately n(n-1)/2 (Brooks' Law).&lt;/li&gt;\n        &lt;li&gt;&lt;strong&gt;Integration Complexity:&lt;/strong&gt; Larger teams often work on interconnected components that require integration.&lt;/li&gt;\n        &lt;li&gt;&lt;strong&gt;Technical Debt:&lt;/strong&gt; Accumulated technical shortcuts that slow down development.&lt;/li&gt;\n        &lt;li&gt;&lt;strong&gt;Process Overhead:&lt;/strong&gt; Time spent on meetings, documentation, and other non-coding activities.&lt;/li&gt;\n    &lt;/ul&gt;\n    &lt;p&gt;Adjust the sliders to see how different factors affect productivity across team sizes.&lt;/p&gt;\n    &lt;p&gt;The heatmaps show the combined effect of team size and each individual factor on productivity.&lt;/p&gt;\n    &lt;p&gt;Productivity is normalized to a scale of 0-1, where 1 represents optimal productivity per team member.&lt;/p&gt;\n    "}},{"type":"object","name":"Column","id":"p1266","attributes":{"width":300,"children":[{"type":"object","name":"Slider","id":"p1260","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:value",[{"type":"object","name":"CustomJS","id":"p1264","attributes":{"args":{"type":"map","entries":[["source",{"type":"object","name":"ColumnDataSource","id":"p1001","attributes":{"selected":{"type":"            // Calculate actual productivity\n            const actual_productivity = ideal_productivity * communication_impact * integration_impact * tech_debt_impact * process_impact;\n            \n            // Normalize to 0-1 scale (changed from 0-100)\n            return Math.min(1.0, actual_productivity / ideal_productivity);\n        }\n        \n        // Update the main line plot\n        for (let i = 0; i &lt; team_sizes.length; i++) {\n            productivity[i] = calculateProductivity(team_sizes[i], comm_oh, integ_comp, tech_debt, proc_oh);\n        }\n        \n        // Update the heatmap data\n        // For communication heatmap\n        const comm_team_sizes = comm_source.data.team_size;\n        const comm_factors = comm_source.data.factor;\n        const comm_productivity = comm_source.data.productivity;\n        \n        for (let i = 0; i &lt; comm_team_sizes.length; i++) {\n            const team_size = comm_team_sizes[i];\n            const factor = comm_factors[i];\n            comm_productivity[i] = calculateProductivity(team_size, factor, integ_comp, tech_debt, proc_oh);\n        }\n        \n        // For integration heatmap\n        const integ_team_sizes = integ_source.data.team_size;\n        const integ_factors = integ_source.data.factor;\n        const integ_productivity = integ_source.data.productivity;\n        \n        for (let i = 0; i &lt; integ_team_sizes.length; i++) {\n            const team_size = integ_team_sizes[i];\n            const factor = integ_factors[i];\n            integ_productivity[i] = calculateProductivity(team_size, comm_oh, factor, tech_debt, proc_oh);\n        }\n        \n        // For technical debt heatmap\n        const tech_team_sizes = tech_debt_source.data.team_size;\n        const tech_factors = tech_debt_source.data.factor;\n        const tech_productivity = tech_debt_source.data.productivity;\n        \n        for (let i = 0; i &lt; tech_team_sizes.length; i++) {\n            const team_size = tech_team_sizes[i];\n            const factor = tech_factors[i];\n            tech_productivity[i] = calculateProductivity(team_size, comm_oh, integ_comp, factor, proc_oh);\n        }\n        \n        // For process overhead heatmap\n        const proc_team_sizes = proc_source.data.team_size;\n        const proc_factors = proc_source.data.factor;\n        const proc_productivity = proc_source.data.productivity;\n        \n        for (let i = 0; i &lt; proc_team_sizes.length; i++) {\n            const team_size = proc_team_sizes[i];\n            const factor = proc_factors[i];\n            proc_productivity[i] = calculateProductivity(team_size, comm_oh, integ_comp, tech_debt, factor);\n        }\n        \n        // Trigger updates for all data sources\n        source.change.emit();\n        comm_source.change.emit();\n        integ_source.change.emit();\n        tech_debt_source.change.emit();\n        proc_source.change.emit();\n    "}}]]]},"title":"Communication Overhead","start":0,"end":1,"value":0.5,"step":0.01}},{"id":"p1261"},{"id":"p1262"},{"id":"p1263"}]}}]}},{"type":"object","name":"Row","id":"p1268","attributes":{"children":[{"type":"object","name":"Figure","id":"p1004","attributes":{"height":400,"x_range":{"type":"object","name":"DataRange1d","id":"p1005"},"y_range":{"type":"object","name":"DataRange1d","id":"p1006"},"x_scale":{"type":"object","name":"LinearScale","id":"p1014"},"y_scale":{"type":"object","name":"LinearScale","id":"p1015"},"title":{"type":"object","name":"Title","id":"p1007","attributes":{"text":"Productivity vs Team Size"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p1045","attributes":{"data_source":{"id":"p1001"},"view":{"type":"object","name":"CDSView","id":"p1046","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p1047"}}},"glyph":{"type":"object","name":"Line","id":"p1042","attributes":{"x":{"type":"field","field":"team_size"},"y":{"type":"field","field":"productivity"},"line_color":"navy","li
